[特徴]<BR>
肌触りの良いボアに、スポーティなタフタをミックスしたデザインのジャケット。<br>
身頃裏は暖かいトリコット起毛素材、袖裏はすべりの良いタフタ素材です。<br>
■衿裏も肌触りがよく暖かいボア。<br><hr>
【あす楽対応は北海道のみです】<BR>
